import React from 'react'
import styled from 'styled-components';

const ButtonStart = styled.a`
margin-top:15rem;
border:1px solid green;
padding:50px 40px;
border-radius:100%;
`;

const ButtonText =styled.div`
`;

function StartButton() {
  return (
    <ButtonStart>
        <ButtonText>
                Start
        </ButtonText>
    </ButtonStart>
  )
}

export default StartButton
